import styled from "styled-components";
import { Link } from "react-router-dom/dist/index.mts";

const BlueButton = styled(Link)`
    background-color: blue;
    color: white;
    border:0;
    border-radius: 5px;
    padding: 12px 10px;
    text-decoration: none;
    `;


export default BlueButton;
